import LoginPage from "../Views/WebSite/LoginPage.js";
import RegisterPage from "../Views/WebSite/RegisterPage.js";

// @material-ui/icons
import Image from "@material-ui/icons/Image";

var dashRoutes = [   
    {
        path: "/login-page",
        name: "Login Page",
        mini: "L",
        component: LoginPage,
        layout: "/auth"
    },
    {
        path: "/register-page",
        name: "Register Page",
        mini: "R",
        component: RegisterPage,
        layout: "/auth"
    },
    {
        path: "/services",
        name: "Services",
        mini: "R",
        component: RegisterPage,
        layout: "/auth"
    }
];
export default dashRoutes;
